import React, { useState } from "react";
import makeStyles from "@mui/styles/makeStyles";
import { Grid, Typography,Button } from "@mui/material";
import Line from "../Components/About/img/Line.svg";

const useStyles = makeStyles((theme) => ({
  main: {
    background: "linear-gradient(360deg, #FFF 0%, #F4F5F7 100%)",
    maxWidth: "1600px",
    margin: "auto",
  },
  buttonText: { fontSize: "18px", lineHeight: "25px", textTransform: "none" },
  brandsTitle: {
    marginTop: "80px",
  },
  line: { marginTop: "20px" },
}));

export default function Contact() {
  const [active, setActive] = useState("pepino");
  const classes = useStyles();
  return (
    <>
      <Grid container className={classes.main}>
      <Grid
          container
          item
          alignItems="center"
          justifyContent="center"
          spacing={8}
        >
          <Grid item xs={7}>
            <Typography
              variant="subtitle1"
              className={classes.brandsTitle}
              color="primary"
            >
              Markalar
            </Typography>
          </Grid>

          <Grid item xs={7}>
            <Button
              onClick={() => setActive("pepino")}
              style={{ background: 0 }}
              disableRipple={1}
            >
              <Typography color="primary" className={classes.buttonText}>
                Pepino
              </Typography>
            </Button>
            <Button
              onClick={() => setActive("flyer")}
              style={{ background: 0 }}
              disableRipple={1}
            >
              <Typography color="primary" className={classes.buttonText}>
                Flyer
              </Typography>
            </Button>
            <Button
              onClick={() => setActive("lilypari")}
              style={{ background: 0 }}
              disableRipple={1}
            >
              <Typography color="primary" className={classes.buttonText}>
                Lilypary
              </Typography>
            </Button>
          </Grid>
        </Grid>
        <img src={Line} className={classes.line} />

      </Grid>
    </>
  );
}
